import React,{useState} from "react";
import Logo from "../img/Alogo.svg";

export default function Loginimg() {

    const [userId, setUserId] = useState("");
    const [password, setPassword] = useState("");
    const [username, setUsernamer] = useState(false);
    const [passworderror, setPassworderror] = useState("");
  
    // const handleTogglePassword = () => {
    //   setShowPassword(!showPassword);
    // };
  
    const handleLogin = (e) => {
      e.preventDefault();
      setUsernamer('');
      setPassworderror('');
      // Perform login validation here
      if (userId === "admin"  && password === 'admin') {
        // console.log('Logged in!');
        // window.open('/dashboard', '_blank');
        // setError("Please enter user ID");
      } else {

        if (userId !== 'admin') {
            setUsernamer('Invalid username');
          }
          if (password !== 'admin') {
            setPassworderror('Invalid password');
          }
        // setError("Please enter password");
      }
    //    else {
    //     // Perform login logic here
    //     // You can make API calls or perform any other validation as per your application's requirements
    //     // If login is successful, navigate to next page or perform other actions
    //     setError("");
    //   }
    };
  return (
    <>
      <div className="Logo">
        <div className="side-bar">
          <img src={Logo} width={150} /> <br />
          <form action="" onSubmit={handleLogin}> 
            <input
            name="user"
            id="user"
              type="text"
              className="Login-input"
              placeholder="Enter user id"
              value={userId}
              onChange={(e) => setUserId(e.target.value)}
              onKeyPress={() =>setUsernamer('') }
            />
           <div className="container-error">
           {username && <div className='error' style={{color: "red"}}>{username}</div>}
           </div>
             {/* {error && <p style={{color: "red"}}>{error} </p>} */}
            <div className="form_item">
              <input type="password" 
              name="passw"
              id="passw"
              placeholder="Password..." className="Login-input"value={password}
                onChange={(e) => setPassword(e.target.value)}
                onKeyPress={() => setPassworderror('')}
                />
                <div className="container-error">
                {passworderror && <div className='error' style={{color: "red"}}>{passworderror}</div>}
                </div>
                 {/* {error && <p style={{color: "red"}}>{error}</p>} */}
              <i className="fa-solid fa-eye" id="eye"></i>
              <button type="submit" classname="btn btn-outline-primary d-flex justify-content-end" >Login</button>
            </div>
          </form>
        </div>
      </div>
    </>
  );
}
